#
# Structure for table "person"
#

DROP TABLE IF EXISTS `person`;
CREATE TABLE `person` (
  `pk` int(11) NOT NULL DEFAULT '0',
  `id` varchar(20) NOT NULL,
  `rank` int(2) DEFAULT NULL,
  `name` varchar(100) NOT NULL,
  `mil_force` int(1) DEFAULT NULL,
  `gender` int(1) DEFAULT NULL,
  `unit_show` varchar(100) DEFAULT NULL,
  `unit_case` varchar(100) DEFAULT NULL,
  `unit_case_super` varchar(100) DEFAULT NULL,
  `gid` varchar(100) DEFAULT NULL,
  `status_super` int(2) NOT NULL DEFAULT '0',
  `status_little` int(2) NOT NULL DEFAULT '0',
  `pictype` varchar(100) DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

