                          where  sid is not null
                       )
                order by RAND() limit 1;   
             else
                select id               
                  into person_get
                from 		person                
                where  status = 0  
                 and   gid =  Vgid             
                 and   id not in                 
                       (                       
                          select sid                          
                          from   gift_20                          
