             where  rank = 2 and status_little = 0 and unit_case = Vuint
             ORDER BY RAND()
             LIMIT 1 ;  
             
             insert into log_gift(DT_set,mode,desc_gift,from_pos)
              values(now(), 'little_radom', concat('รางวัลย่อยประเภท แก้ERROR ',Vtype,' | รหัส ',gift, ' ',gift_name,' | ผู้ได้รับ ',person, ' ',person_name ,' | หน่วย ',' ',buff_unit), 'P_Random_Little เป็น function ใน db');
         else
              insert into log_gift(DT_set,mode,desc_gift,from_pos)
              values(now(), 'little_radom', concat('รางวัลย่อยประเภท ',Vtype,' | รหัส ',gift, ' ',gift_name,' | ผู้ได้รับ ',person, ' ',person_name ,' | หน่วย ',' ',buff_unit), 'P_Random_Little เป็น function ใน db');       
               
