#
# Procedure "p_set_horse"
#

DROP PROCEDURE IF EXISTS `p_set_horse`;
CREATE PROCEDURE `p_set_horse`(VhorseId int,VhorseDirec varchar(2))
begin

     DECLARE HrDr   int;     
          
          if VhorseDirec = 'F' then    SET HrDr = 1;      
          else                         SET HrDr = -1;          
          end if;          

        -- set horse number        
        if VhorseId = 1 then
            update control_page_state    
            set status  = 1, 
                marg_val = HrDr   
            where    marg_name = 'HORSE_1';          
                         
        elseif VhorseId = 2 then     
            update control_page_state    
            set status  = 1, 
                marg_val = HrDr   
            where    marg_name = 'HORSE_2';                       
        elseif VhorseId = 3 then     
            update control_page_state    
            set status  = 1, 
                marg_val = HrDr   
            where    marg_name = 'HORSE_3';                       
        elseif VhorseId = 4 then     
            update control_page_state    
            set status  = 1, 
                marg_val = HrDr   
            where    marg_name = 'HORSE_4';                        
        elseif VhorseId = 5 then     
            update control_page_state    
            set status  = 1, 
                marg_val = HrDr   
            where    marg_name = 'HORSE_5';                      
        elseif VhorseId = 6 then     
            update control_page_state    
            set status  = 1, 
                marg_val = HrDr   
            where    marg_name = 'HORSE_6';                        

        end if;   

end;

#
# Procedure "p_set_screen"
#

DROP PROCEDURE IF EXISTS `p_set_screen`;
CREATE PROCEDURE `p_set_screen`(Sname varchar(200),Vcase varchar(100))
BEGIN
                                    
        if Sname = 'read' then        
                        update control_page_state    
                        set 
                                status       = 1  
                        where   marg_name in ('TOP','BOTTOM','LEFT','RIGHT');
        end if;

        if Vcase = 'inc' then          
           if      Sname = 'TOP' then
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val + 1) ,
                                status       = 1  
                        where   marg_name    = 'TOP';                        
           elseif  Sname = 'BOTTOM' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val + 1)  ,
                                status       = 1    
                        where   marg_name    = 'BOTTOM';                    
           elseif  Sname = 'LEFT' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val + 1)  ,
                                status       = 1    
                        where   marg_name    = 'LEFT';                  
           elseif  Sname = 'RIGHT' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val + 1)  ,
                                status       = 1   
                        where   marg_name    = 'RIGHT';                 
           elseif  Sname = 'MRG_BR' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val + 4)  ,
                                status       = 1   
                        where   marg_name    = 'MRG_LEFT_BLOCKRN';    
           end if;
           
        elseif Vcase = 'dec' then     
           if      Sname = 'TOP' then
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val - 1) ,
                                status       = 1     
                        where   marg_name    = 'TOP';                        
           elseif  Sname = 'BOTTOM' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val - 1) ,
                                status       = 1     
                        where   marg_name    = 'BOTTOM';                    
           elseif  Sname = 'LEFT' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val - 1) ,
                                status       = 1     
                        where   marg_name    = 'LEFT';                  
           elseif  Sname = 'RIGHT' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val - 1) ,
                                status       = 1     
                        where   marg_name    = 'RIGHT';               
           elseif  Sname = 'MRG_BR' then     
                        update control_page_state    
                        set 
                                marg_val     =  (marg_val - 4) ,
                                status       = 1     
                        where   marg_name    = 'MRG_LEFT_BLOCKRN';    
           end if;
        end if;
                

END;

#
# Procedure "p_showpage"
#

DROP PROCEDURE IF EXISTS `p_showpage`;
CREATE PROCEDURE `p_showpage`(Vpage int)
BEGIN
        -- clear state 
        update control_page    
        set page_set  = 0,    
            page_read = 0;  
                                    
        -- set state of page
        update control_page    
        set page_set     = 1,    
            page_read    = 1
        where page_id = Vpage;  
END;

#
# Procedure "p_swap"
#

DROP PROCEDURE IF EXISTS `p_swap`;
CREATE PROCEDURE `p_swap`(v1 double, v2 double)
BEGIN
     
     declare swap1 double;
     declare swap2 double;
     
     select number
     into  swap1
     from superaward_status
     where seq = v1;
     
     select number
     into  swap2
     from superaward_status
     where seq = v2;
      
   
     update superaward_status
      set 
        seq = v1
     where number = swap2;
     
     update superaward_status
      set 
        seq = v2
     where number = swap1;
      
END;

#
# Procedure "P_waiver"
#

DROP PROCEDURE IF EXISTS `P_waiver`;
CREATE PROCEDURE `P_waiver`(Vgid int)
BEGIN
    DECLARE    Uid     varchar(20);
    DECLARE    Uname   varchar(100);
    DECLARE    Pname   varchar(100);
    DECLARE    Pid     varchar(20);
    
     select unit_id,unit,sid
       into Uid,Uname,Pid
     from   superaward_status
     where  number = Vgid;
     
     select name
       into Pname
     from   person
     where  id = Pid;
    
     update superaward_status
     set
            sid       = null,
            unit      = null,
            unit_id   = null,
            status    = 0
     where  sid = Pid;
    
     update superaward_unit
     set
            status    = 0
     where  unit_id = Uid;
     
     
/*            LOG                   */

        insert into log_gift(DT_set,mode,desc_gift,from_pos)
        values(now(), 'waiver_person', concat('สละสิทธิ์ของหน่วย : ',Uname,' รหัส : ',Uid,' | ผู้สละสิทธิ์:',Pname,' รหัส : ',Pid ), 'P_waiver เป็น Procedure ใน db');    

/*            LOG                   */

END;
